  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Hagerman NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Hagerman NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, information on the Refuge environment
  and administration, and strategies for plan implementation. Key planning issues
  include: inventories and monitoring, grassland management, water management, environmental
  education, funding, staffing, and oil and gas activities.\",\n\t\"license_title\":
